import React, { Component } from 'react'

export default class Us extends Component {
 


    render() {
        return (
            <div className='user'>

                {
                    this.props.kategor.map(kategori => (
                        <div>
                            <ul><li key={kategori.id} onClick={()=>this.props.change(kategori)}> {kategori.name} </li></ul>
                        </div>

                   ) )
                }

                    <h1>{this.props.context}</h1>
            </div>
        )
    }
}
